import React from "react";
import styles from "./index.module.css"
import RegistrationForm from "../../Camponents/Registration_form/RegistrationForm";
import AuthorizationForm from "../../Camponents/AuthorizationForm/AuthorizationForm";
import DouthReqestForm from "../../Camponents/DoughForm/DoughReqestForm";

const HomePage=()=>{
    return(
        <div className="">
            <h1>Pizza Craft</h1>
            <div className={styles.formContainer}>
        <AuthorizationForm></AuthorizationForm>
        </div>
        </div>
    )
}
export default HomePage;
